function ThesesChart({chartData}) {
    return (
       <Line 
       data = {chartData} 
       options={
        {
          type: 'line',
          data: {chartData},
          options: {
            responsive: true,
            plugins: {
              tooltip: {
                mode: 'index',
                intersect: false
              },
              title: {
                display: true,
                text: "stacked line chat"
              }
            },
            hover: {
              mode: 'index',
              intersec: false,
            },
            scales: {
              x: {
                stacked:true,
                title: {
                  display: true,
                  text: 'year'
                }
              },
              y: {
                stacked: true,
                title: {
                  display: true,
                  text: 'count'
                },
                min: 0,
                max:1500,
                ticks: {
                  stepSize: 100
                }
              }
            }
          },
        }
       }
       />
    );
}

export default ThesesChart
